import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';
import Home from './components/Home';
import OrderOnline from './components/OrderOnline'; // Import OrderOnline component
import ShopInStore from './components/ShopInStore'; // Import ShopInStore component
import Products from './components/Products'; // Import Products component if needed
import backgroundImg from './background.PNG'; // Adjust path as per your project

const App = () => {
  return (
    <Router>
      <div className="App" style={{ backgroundImage: `url(${backgroundImg})` }}>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/order-online" element={<OrderOnline />}>
            {/* Nested route for ShopInStore */}
            <Route path="shop-in-store" element={<ShopInStore />} />
          </Route>
          {/* Example route for Products component */}
          {/* <Route path="/products" element={<Products />} /> */}
        </Routes>
      </div>
    </Router>
  );
};

export default App;
